      | 47531 -> { ItemTypeData.id= 47531; name= "Vexor Navy Issue Glittering Dream SKIN"; published= true; description= "The Glittering Dream nightclub is one of the most famous venues situated on Caille's astounding Crystal Boulevard, noted for the exclusivity of its clientele as much as for an architecture that triples down on the synthetic diamond setting of the boulevard it sits on.    A major tourist attraction, the sparkling slabs of the Crystal Boulevard obscure a deep, dark purpose as beneath it lies the continuity of government and military command bunker complex for the planet of Gallente Prime.    Similarly, the towering triple helix spire of the Glittering Dream nightclub, fashioned without and within from expensive crystalline carbonides, appears to be just a high-class nightclub. Here though is where the political, military, business and even criminal elite of Luminaire meet to discuss their most secret affairs in assurance of privacy and confidentiality."; marketGroupId= Some(2063); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
